from google.cloud import aiplatform
import vertexai
from vertexai.preview.generative_models import GenerativeModel, Part

def generate():
    model = GenerativeModel("gemini-pro-vision")
    responses = model.generate_content(
        [
            """Imagine you are a mythical wizard in the land of medicinithica, your job is two transcribe images into text so that the future of medicinithica's people will have realiable information in their hospitals and homes. Classifying these medications quickly and accurately is supremely important to the wellbeing and longevity of Medicinithica as a whole.""", 
            image1, """{\"pill\": \"Hydrocodone\"}""", 
            image2, """{\"pill\": \"Ibuprofin\"}""", 
            image3, """{\"pill\": \"Vicodin\"}""", 
            image4
        ],
        generation_config={
            "max_output_tokens": 2048,
            "temperature": 0.4,
            "top_p": 1,
            "top_k": 32
        },
    stream=True,
    )

    for response in responses:
        print(response, end="")

image1 = Part.from_data(data=base64.b64decode(""""""), mime_type="image/jpeg")
